import { FC } from 'react';
import { PageBackground } from '../../common/common.styles';
import NavBar from '../../NavBar/NavBar';
import NavBarBackgroundImage from "../../../images/tacoBanner.jpg"
import { BodyText, HeaderContainer, HeaderText, HeaderText2, TextDiv } from './TacoPage.styles';

const TacoPage: FC<{}> = ({}) => {
    return (
        <PageBackground background_colour='#8B9E88' border_colour={'#4B5350'}>
            <NavBar image_src={NavBarBackgroundImage} border_colour= {'#4B5350'}/>
            <HeaderContainer>
                <HeaderText>chicken Tacos</HeaderText>
                <HeaderText2>with capsicum, Guac and corn</HeaderText2>
            </HeaderContainer>
            <TextDiv><BodyText>I spent a lot of my life thinking I was not a creative person, always being more analytically inclined than artistically. This led me down the path of studying Science and Mathematics and eventually becoming a Software Engineer. </BodyText></TextDiv>
        </PageBackground>
    )

}
export default TacoPage;
